import React from "react";
import Presentation from "../Presentation";
import { setLogoIsShowing } from "../../slices/rootSlice";
import BackgroundContainer from "../BackgroundContainer";
import { useEffect } from "react";
import { useDispatch } from "react-redux";

function Login() {
  return (
    <div style={{ display: "flex", flexDirection: "column", height: "100%" }}>
      <Presentation
        title="Login"
        desc="Lorem ipsum dolor sit amet, consectetur adipiscing elit. Morboa."
      />
      <BackgroundContainer height={70}>
        <form className="App__form">
          <label>
            E-mail
            <input type="email" />
          </label>
          <label style={{ marginTop: "2.8rem" }}>
            Senha
            <input type="password" />
          </label>
          <button type="submit" style={{ marginTop: "2.8rem", width: "100%" }}>
            Login
          </button>
        </form>
        <div className="App__registerAdvice">
          Não tem uma conta? Registre-se
        </div>
      </BackgroundContainer>
    </div>
  );
}

export default Login;
